import './Header.css';
import { NavLink } from "react-router-dom";
import logo from "../../media/logo.png";

export const Header = () => {

    return (
        <header>
            <div id="logo">
                <h2 id="logo-text">Weather App</h2>
            </div>
            <div id="menu">
                <ul>
                    <NavLink to="/">
                        Home
                    </NavLink>
                    <NavLink to="/favorites">
                        Favorites
                    </NavLink>
                </ul>
            </div>
        </header>
    )
}
